{
    "$id": "/schemas/numericAxis",
    "description" : "Simple axis with numeric values",
    "oneOf" :
    [
        {
            "description" : "A regularly-spaced numeric axis",
            "properties" :
            {
                "start" : { "type" : "number" },
                "stop" : { "type" : "number" },
                "num" :
                {
                    "type" : "integer",
                    "minimum" : 1
                }
            },
            "required" : [ "start", "stop", "num" ],
            "additionalProperties" : false
        },
        {
            "description" : "Axis defined by list of numeric axis values and optional bounds",
            "properties" :
            {
                "dataType" : { "const" : "primitive" },
                "values" :
                {
                    "type" : "array",
                    "items" : { "type" : "number" },
                    "minItems" : 1,
                    "uniqueItems" : true
                },
                "bounds" :
                {
                    "description" : "Optional axis bounds. Must be twice as long (and same data type) as \"values\"",
                    "type" : "array",
                    "items" : { "type" : "number" },
                    "minItems" : 2
                }
            },
            "required" : [ "values" ],
            "additionalProperties" : false
        }
    ]
}{
    "$id": "/schemas/stringAxis",
    "description" : "Simple axis with string values (e.g. time strings)",
    "properties" :
    {
        "dataType" : { "const" : "primitive" },
        "values" :
        {
            "type" : "array",
            "items" : { "type" : "string" },
            "minItems" : 1,
            "uniqueItems" : true
        },
        "bounds" :
        {
            "description" : "Optional axis bounds. Must be twice as long (and same data type) as \"values\"",
            "type" : "array",
            "items" : { "type" : "string" },
            "minItems" : 2
        }
    },
    "required" : [ "values" ],
    "additionalProperties" : false
}{
    "$id": "/schemas/tupleAxis",
    "description" : "Tuple-based axis",
    "properties" :
    {
        "dataType" : { "const" : "tuple" },
        "values" :
        {
            "type" : "array",
            "items" :
            {
                "description" : "A tuple of axis values (numbers or strings)",
                "type" : "array",
                "items" :
                {
                    "oneOf" :
                    [
                        { "type" : "number" },
                        { "type" : "string" }
                    ]
                },
                "minItems" : 2
            },
            "minItems" : 1,
            "uniqueItems" : true
        },
        "coordinates" :
        {
            "type" : "array",
            "items" : { "type" : "string" },
            "minItems" : 2
        }
    },
    "required" : [ "dataType", "values", "coordinates" ],
    "additionalProperties" : false
}{
    "$id": "/schemas/polygonAxis",
    "description" : "Polygon-based axis",
    "properties" :
    {
        "dataType" : { "const" : "polygon" },
        "values" :
        {
            "type" : "array",
            "items" :
            {
                "description" : "A GeoJSON polygon",
                "type" : "array",
                "items" :
                {
                    "type" : "array",
                    "items" :
                    {
                        "description" : "The inner array: the coordinates themselves",
                        "type" : "array",
                        "items" : { "type" : "number" },
                        "minItems" : 2
                    },
                    "minItems" : 1
                },
                "minItems" : 1
            },
            "minItems" : 1,
            "uniqueItems" : true
        },
        "coordinates" :
        {
            "type" : "array",
            "items" : { "type" : "string" },
            "minItems" : 2
        }
    },
    "required" : [ "dataType", "values", "coordinates" ],
    "additionalProperties" : false
}
